!!!РАСПРОДАЖА!!! Цена приложения 15р вместо 149р !!!УСПЕВАЙТЕ!!!

Покупки! - Ваш помощник в магазинах - это простой и удобный в составлении список покупок,  благодаря которому Вы избежите незапланированных покупок, сэкономите время и бюджет!

Основные особенности приложения:

- Составление нескольких списков на все случаи жизни, например на каждый день, на день рождения, на новый год, на ремонт и т.д.;
- Возможность указывать цену на продукты и показ итоговой суммы списка, тем самым подойдя к кассе Вы будете точно знать общую сумму всех продуктов;
- Группировка продуктов по разделам, а приложение само сделает сортировку продуктов в списке по отделам, как в магазине;
- Вычёркивание из списка тех продуктов, которые уже положили в свою тележку;
- Авто-подбор по первым двум-трём буквам продукта поможет составить список покупок быстро и легко!;
- Отправка составленных списков покупок по WhatsApp, E-mail, SMS;
- Синхронизация составленных списков через iCloud;
- Возможность создавать напоминания прямо из приложения (теперь Вы точно не забудете после работы купить соль или билеты в кино!!!);
- Другие приятные возможности приложения, которые облегчат походы по магазинам. 

